import React, { FC } from 'react';

interface NavigationProps {
    link1: string;
    link2: string;
    link3: string;
    link4: string;
}

const Navigation: FC<NavigationProps> = ({ link1, link2, link3, link4 }) => {
  return (
    <nav className="relative p-6 max-w-lg">
      <div className="flex flex-row m-0 justify-evenly">
        <h1 className="text-gold hover:underline"><a href="resume.pdf" download>{link1}</a></h1>
        <h1 className="text-forest-green hover:underline"><a href="#portfolio">{link2}</a></h1>
        <h1 className="text-forest-green hover:underline"><a href="#contact">{link3}</a></h1>
        <h1 className="text-forest-green hover:underline"><a href="#blog">{link4}</a></h1>
      </div>
    </nav>
  );
};

export default Navigation;
